@madhavajay  Yup! It's [this one](https://github.com/OpenMined/PySyft/blob/3551725d6749309bb2ffb60ec6b5566318a7361b/src/syft/grid/client/grid_connection.py#L17). We set it [here](https://github.com/OpenMined/PySyft/blob/d358e191874c4f5e331ebaa1150b4c9c6e3d64b8/src/syft/grid/client/client.py#L60). It's expected by the user to set the proper connection type _(choosing the proper communication protocol they want to use to connect with PyGrid. eg: HTTP, Websocket, WebRTC, etc.)_

The problem is: when it was developed, we still had that concept of the node types in mind, so it was designed to be created dynamically, extending the proper node client (Network, Domain, Device, and VirtualMachine) and using the proper Connection (HTTP, Websocket, WebRTC ... ) in order to give support to all client types and node connections using a single function: `connect`. 

_PS : Since we'll be removing the node types architecture from the next versions, we'll probably refactor this client as well ._

